syms x1 x2 x3 u v real
x = [x1;x2;x3];

S = [1 1 0 ; 0 0 -1 ; 1 0 0];
iS = inv(S) %[output:8bab44f2]
A = S * diag([-1,-2,-3]) / S %[output:348ea388]
f = A*x + [x3*x2 ; -x1*x3 ; x1^2*x2] %[output:6627b22b]
g = [1;0;1];
h = x1;            
%%
%[text] ## The output function: $\\Phi\_1(x) = h(x)$
Phi1 = h %[output:3f07f5c1]
Lie(1,g,Phi1,x) %[output:21ea26fd]
%[text] The first derivative: $\\Phi\_2(x) = L\_f h(x) + L\_g h(x) \\, u$, where $L\_g h(x) \\neq 0$
%[text] 
%[text] The feedback linearizing input: $u = \\frac{v - L\_f h(x)}{L\_g h(x)}$
u_FdbLin = Lie(1,g,Phi1,x) \ (v - Lie(1,f,Phi1,x)) %[output:998750c7]
%[text] As the relative degree is 2, the third output transformation $\\Phi\_3(x)$ is not used in the final coordinates transformation, but $\\Phi(x) = \\pmatrix{ \\Phi\_\\xi(x) \\cr \\Phi\_\\eta(x) }$, where $\\Phi\_\\xi(x) = \\pmatrix{ \\Phi\_1(x) }$
Phi_xi = [Phi1] %[output:97041532]
T_x = jacobian(Phi_xi,x) %[output:74e024c4]
simplify(T_x * x - Phi_xi) %[output:49777749]
%%
%[text] Then, we select $\\Phi\_\\eta(x) $ and check whether $L\_g \\Phi\_\\eta(x) = 0$.
Phi_eta = [x2;x3-x1];
Lg_Phi_eta = Lie(1,g,Phi_eta,x) %[output:4935dbd6]
Phi = [ %[output:group:4171a549] %[output:2ca47b1b]
    Phi_xi %[output:2ca47b1b]
    Phi_eta %[output:2ca47b1b]
    ] %[output:group:4171a549] %[output:2ca47b1b]
J_Phi = jacobian(Phi,x) %[output:99b96db3]
det(J_Phi) %[output:3a1c200e]
%%
%[text] ## Zero dynamics
syms xi eta1 eta2 real
z = [xi;eta1;eta2] %[output:88b5c3e5]
sol = solve(z == Phi,x,"Real",true,"ReturnConditions",false) %[output:71566d9b]
iPhi = [sol.x1 ; sol.x2 ; sol.x3] %[output:1f157c83]
q = subs(subs(Lie(1,f,Phi_eta,x),x,iPhi),xi,xi*0) %[output:8c9d2363]
fig = figure(12), hold on, grid on %[output:44b486d4] %[output:6e121e39]
ezplot(q,[-10,10]) %[output:6087a085] %[output:7a6c5e02]
%[text] The zero dynamics is BISTABLE.
%%
f_cls = f + g*subs(u_FdbLin,v,-10*h)
f_ode = matlabFunction(f_cls,'Vars',{sym('t'),x})
sol = solve([Phi_xi;x2 == 1.01],x)
x0 = double([sol.x1,sol.x2,sol.x3]')
[tt,xx] = ode45(f_ode,[0,10],x0)
figure(13), hold on, grid on, 
plot3(xx(:,1), xx(:,2), xx(:,3))
plot3(xx(1,1), xx(1,2), xx(1,3),'.')
xlabel x1
ylabel x2
zlabel x3
view([90 0])
%%
function ret = Lie(r,f,h,x)
    if r == 1
        ret = jacobian(h,x)*f;
    else
        ret = Lie(1,f,Lie(r-1,f,h,x),x);
    end
end

